  "package.json": {
    "file": {
      "contents": "{\n  \"name\": \"be-wasm\",\n  \"version\": \"1.0.0\",\n  \"description\": \"Express + SQLite (WASM) API and frontend demo for WebContainer\",\n  \"private\": true,\n  \"workspaces\": [\n    \"app\",\n    \"packages/*\"\n  ],\n  \"scripts\": {\n    \"dev\": \"npm run dev -w @viweb/server\",\n    \"start\": \"npm run start -w @viweb/server\",\n    \"dev:container:api\": \"npm run dev:container -w @viweb/server\",\n    \"dev:container:notes\": \"npm run dev:container -w @viweb/client\",\n    \"dev:container\": \"concurrently -k -n api,notes \\\"npm run dev:container:api\\\" \\\"npm run dev:container:notes\\\"\",\n    \"pretest\": \"npm run build:notes && npm run build:runner-ui\",\n    \"test\": \"node --test\",\n    \"build:notes\": \"npm run build -w @viweb/client\",\n    \"build:snapshot\": \"npm run generate:snapshot -w @viweb/app\",\n    \"build:runner-ui\": \"npm run build -w @viweb/app\",\n    \"build:runner\": \"npm run build:notes && npm run build:snapshot && npm run build:runner-ui\",\n    \"typecheck:runner\": \"npm run typecheck -w @viweb/app\",\n    \"typecheck:notes\": \"npm run typecheck -w @viweb/client\",\n    \"typecheck\": \"npm run typecheck:runner && npm run typecheck:notes\"\n  },\n  \"keywords\": [\n    \"express\",\n    \"sqlite\",\n    \"sqljs\",\n    \"webcontainer\",\n    \"wasm\"\n  ],\n  \"author\": \"\",\n  \"license\": \"ISC\",\n  \"type\": \"commonjs\",\n  \"devDependencies\": {\n    \"concurrently\": \"^9.2.1\",\n    \"supertest\": \"^7.2.2\"\n  }\n}\n"
    }
  },
