                          "contents": "import * as React from 'react';\n\nimport { cn } from '@shared/lib/utils';\n\ntype TabsContextValue = {\n  value: string;\n  setValue: (value: string) => void;\n};\n\nconst TabsContext = React.createContext<TabsContextValue | null>(null);\n\nfunction useTabsContext() {\n  const context = React.useContext(TabsContext);\n  if (!context) {\n    throw new Error('Tabs components must be used inside <Tabs>.');\n  }\n\n  return context;\n}\n\nfunction Tabs({\n  value,\n  onValueChange,\n  children,\n  className,\n}: {\n  value: string;\n  onValueChange: (value: string) => void;\n  children: React.ReactNode;\n  className?: string;\n}) {\n  return (\n    <TabsContext.Provider value={{ value, setValue: onValueChange }}>\n      <div className={className}>{children}</div>\n    </TabsContext.Provider>\n  );\n}\n\nfunction TabsList({ className, children }: React.HTMLAttributes<HTMLDivElement>) {\n  return (\n    <div className={cn('inline-flex h-9 items-center rounded-lg bg-muted p-1 text-muted-foreground', className)}>\n      {children}\n    </div>\n  );\n}\n\nfunction TabsTrigger({\n  className,\n  value,\n  children,\n  ...props\n}: React.ButtonHTMLAttributes<HTMLButtonElement> & { value: string }) {\n  const { value: activeValue, setValue } = useTabsContext();\n  const active = activeValue === value;\n\n  return (\n    <button\n      type=\"button\"\n      className={cn(\n        'inline-flex items-center justify-center whitespace-nowrap rounded-md px-3 py-1.5 text-sm font-medium transition-all',\n        active ? 'bg-background text-foreground shadow-sm' : 'text-muted-foreground hover:text-foreground',\n        className\n      )}\n      onClick={() => setValue(value)}\n      {...props}\n    >\n      {children}\n    </button>\n  );\n}\n\nfunction TabsContent({\n  className,\n  value,\n  children,\n  ...props\n}: React.HTMLAttributes<HTMLDivElement> & { value: string }) {\n  const { value: activeValue } = useTabsContext();\n\n  if (activeValue !== value) {\n    return null;\n  }\n\n  return (\n    <div className={cn('mt-2 ring-offset-background', className)} {...props}>\n      {children}\n    </div>\n  );\n}\n\nexport { Tabs, TabsList, TabsTrigger, TabsContent };\n"
